import React from "react";
import style from "../styles/Diplomes.module.css";

function Diplomes() {
  return (
    <section className={style.container}>
      <div className={style.pancarte}>
        <p>MAGE</p>
        <p>THIEF</p>
        <p>WARRIOR</p>
        <p>MONK</p>
      </div>
    </section>
  );
}

export default Diplomes;
